import React from 'react';
import Chatbot from './components/Chatbot';

const App = () => {
  return (
    <div className="h-screen flex items-center justify-center">
      <div className="w-full max-w-md border border-gray-300 rounded-lg shadow-lg">
        <Chatbot />
      </div>
    </div>
  );
};

export default App;
